import React from "react";

const Dashboard = () => {
	const handleLogout = () => {
		const token = localStorage.getItem("token"); // Retrieving token from localStorage
		localStorage.removeItem("token");
		console.log(token); // Logging the token before page reload
		window.location.reload();
	};

	return (
		<div className="container-flui" style={{ position: "relative" }}>
			<div className="btns fix-top right" style={{ position: "absolute", top: 0, right: 0 }}>
				<button className="btn btn-danger" onClick={handleLogout}>
					Logout
				</button>
			</div>
		</div>
	);
};

export default Dashboard;
